```import java.io.*;

public class Main {

    public static void main(String[] args) throws Exception{


        while(true) {
            int[] countArray = new int[26];

            BufferedReader reader = new BufferedReader(new InputStreamReader(<http://System.in|System.in>));
            String input = reader.readLine();

            input = input.toLowerCase();
            input = input.replaceAll("[^A-Za-z]", "");

            for (int i = 0; i &lt; input.length(); i++) {
                char letter = input.charAt(i);
                int arrPosition = letter - 'a';
                countArray[arrPosition] += 1;
            }

            boolean isMultiPanagram = true;
            for (int i = 1; i &lt; countArray.length; i++) {
                if(countArray[i] != countArray[i - 1]){
                    isMultiPanagram = false;
                }
            }
            if(isMultiPanagram &amp;&amp; countArray[0] != 0) {
                System.out.println("multiple panagram " + countArray[0]);
            } else {
                boolean isPanagram = true;
                for (int i = 0; i &lt; countArray.length; i++) {
                    if(countArray[i] == 0) {
                        isPanagram = false;
                        break;
                    }
                }
                if(isPanagram) {
                    System.out.println("panagram");
                } else{
                    System.out.println("not panagram");
                }
            }
        }
    }

}```
